import React from 'react';

const Header = () => {
  return (
    <form>
      <div className="form-group" style={{ display: 'flex' }}>
        <p>Find contacts and leads fast. Get back to business.</p>
        <p>
          <button
            onClick={'props.handleFormSubmit'}
            className="btn btn-primary"
          >
            Get Started
          </button>
        </p>
      </div>
    </form>
  );
};
export default Header;
